actionConfiguration.body:
() => {
		var ret = []
		if (GetMissingSubLotStocktake.data == null) {
			return ret
		}
		if (GetMissingSubLotStocktake.data.data.getStocktakeCount == null) {
			return ret
		}
		for (let i = 0; i < GetMissingSubLotStocktake.data.data.getStocktakeCount.length; i++) {
			var line = GetMissingSubLotStocktake.data.data.getStocktakeCount[i]
			let row = {
				"Location": line.storageLocation.name,
				"Carrier": line.carrier.code,
				"Status": line.status.code
			}
			if (line.owner != null) {
				row["Owner"] = line.owner.companyCode
			}
			ret.push(row)
		}
		return ret


	}

